import React from 'react';

import classes from './Layout.css';
import Toolbar from './../Navigation/Toolbar/Toolbar';
const Layout = (props) =>(
    
    <>
        <ToolBar />
        <main className={classes.Content}>
            {props.children}
        </main>
    </>
    
);

export default Layout;
